import Item from "./Item";

export default function ItemList({filteredCategory, items}) {

    const category = filteredCategory == null ? true : false;
    return (
        <div className="containerItems gap-5">
            {
                items.map((el) => {
                    return (
                        <Item key={el.id} id={el.id} image={el.image} title={el.title}/>
                    )
                })
            }
        </div>
    )
}
